    data: |
      SELECT DISTINCT - cor1.col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet), tab2 (FORMAT parquet) AS cor1;
  - name: tab2

outputs:
  - name: q1963.out
    data: |
      -7
      -78
      -79
